import React from "react";
import {NavLink} from "react-router-dom";


const Menu = () =>{
    return (
        <>
        <NavLink className="a" activeClassName="Menu_Class" to="./About">    About   </NavLink>
        <NavLink activeClassName="Menu_Class" to="./Contact"> Contact  </NavLink>
        </>
    )
}

export default Menu;
